    <>
    <h1>Netflix</h1>
    <p>Here the list of my favorite 5 netflix series</p>
    <ol>
        <li>Dark</li>
        <li>My Holo Love</li>
        <li>My Holo Love</li>
    </ol>
    </>,
    document.getElementById('root')
    );









